import './App.css';
import React from 'react';

class App extends React.Component {
  state ={
    name:'cx'
  }
  onClick=(a)=>{
    this.setState({
      name:a
    })
  }
  render() {
    return (
      <div className="App">
        <div>{this.state.name}</div>
        <button onClick={(e)=>this.onClick}>修改</button>
      </div>
    );
  }
}
export default App;
